name: list-models
description: Lists the versions of a model in an Amazon Lookout for Vision project.
flags:
    --cli-input-json=: Read arguments from the JSON string provided
    --cli-input-yaml=: Read arguments from the YAML string provided
    --generate-cli-skeleton: Prints a JSON skeleton to standard output without sending an API request
    --max-results=: The maximum number of results to return per paginated call.
    --next-token=: If the previous response was incomplete (because there is more data to retrieve), Amazon Lookout for Vision returns a pagination token in the response.
    --project-name=!: The name of the project that contains the model versions that you want to list.
